void solve() {
	//assert(szof(inds) == 289);
	vector<bool> bits;
	for (char c : encoded) {
		int cur = c;
		if (c > '\\') {
			--cur;
		}
		cur -= 50;
		for (int j = 0; j < 6; ++j) {
			bits.push_back(cur & (1 << j));
		}
	}
	// for (int i = 0; i < 20; ++i) {
	// 	cerr << bits[i];
	// }
	// cerr << endl;
	int c = 0;
	for (int i = 0; i < 289; ++i) {
		for (int j = 0; j < 289; ++j) {
			for (int k = 0; k < 4; ++k) {
				real_dist[i][j] |= bits[c++] << k;
			}
		}
	}

	vector<int> sieve(MAXV);

	for (int i = 2; i < MAXV; ++i) {
		if (!sieve[i]) {
			sieve[i] = i;
			for (ll j = (ll) i * i; j < MAXV; j += i) {
				sieve[j] = i;
			}
		}
	}

	function<int(int)> get_ind = [&](int a) {
		// cerr << a << endl;
		vector<int> pows;
		map<int, int> cnt;
		int tmp = a;
		while (tmp > 1) {
			int div = sieve[tmp];
			cnt[div]++;
			tmp /= div;
		}

		for (pii p : cnt) {
			pows.push_back(p.ss);
		}

		sort(pows.begin(), pows.end());

		// for (int num : pows) {
		// 	cerr << num << " ";
		// }
		// cerr << endl;

		ull h = 0;
		for (int num : pows) {
			h = h * 23 + num;
		}

		return inds[h];
	};

	int t;
	cin >> t;
	for (int i = 0; i < t; ++i) {
		int a, b;
		cin >> a >> b;
		int ind1 = get_ind(a);
		int ind2 = get_ind(b);

		cout << real_dist[ind1][ind2] << "\n";
	}
}


